import React, {Component} from 'react';

class Mail extends Component {
    render() {
        return (
            <div className={'container-fluid contact pb-5 mail'}>
                <div className={'container'}>

                    <div className="h-25 container">

                    </div>

                    <div className={'container forms row'}>
                        <input id={'email'}
                               type={'email'}
                               placeholder={'Email'}
                               className={'col-10 offset-1 text-center'}/>
                        <br/>
                        <textarea id={'text'}
                                  className={"col-10 offset-1 mt-3 "}/>
                        <br/>
                        <button className={'col-10 offset-1 mt-3 button'}>Send</button>
                    </div>

                </div>
            </div>
        );
    }
}

export default Mail;
